import React from 'react';
import Component from 'react';
import styled from 'styled-components';

const SideNav = styled.div`
    height: 100%;
    width: 25%;
    position: fixed;
    z-index: 1;
    top: 0;
    left: 0;
    overflow-x: hidden;
    padding-top: 20px;
`

class Sidebar extends Component {
    state = {
        names: ["bob", "joe"]
    };

    render() {
        return(
            <SideNav>

            </SideNav>
        )
    }
}

export default Sidebar;
